import React from "react";
import { NavLink, useHistory } from "react-router-dom";
import "./NavBar.css";
import Dropdown from "react-bootstrap/Dropdown";
import "bootstrap/dist/css/bootstrap.min.css";

export default function NavBar() {
  const history = useHistory();
  return (
    <div className="nav-bar">
      <NavLink to="/homeview" className="meme-book">
        Meme <br />
        <span
          style={{
            color: "black",
            fontSize: "50px",
            textShadow: "0 0 2px white",
          }}
        >
          Book
        </span>
      </NavLink>
      {/* <img src="./images/upload.png" alt="upload" className="meme-upload"/> */}
      <button
        to="/homeview/upload"
        className="meme-upload"
        title="Upload Meme"
      ></button>
      <button to="/homeview/create" className="meme-create"></button>
      {/* <button to="/homeview/profile" className="meme-profile"></button> */}
      <Dropdown>
        <Dropdown.Toggle id="custom">
          <button to="/homeview/profile" className="meme-profile"></button>
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <Dropdown.Item href="#/action-1" onClick={history.push("/setprofile")}>Set Profile</Dropdown.Item>
          <Dropdown.Item href="#/action-3">Logout</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    </div>
  );
}
